import React from 'react';
import './app-header.css';

const AppHeader = () => {
  return (
    <span className="app-header">
      <h1 className="h1"> My Todo List </h1>,
      <h2 className="h2"> 1 more to do, 3 done </h2>
    </span>
  );
};

export default AppHeader;
